import React from "react";

export const Header = (props) => {
  return (
    <header id="header">
      <div className="intro">
        <div className="overlay">
          <div className="container">
            <div className="row">
              {/* Logo Section */}
              <div className="col-md-4 logo-section">
                <img
                  src="/img/intro-bg.png" // Path to your logo image
                  alt="Company Logo"
                  style={{
                    width: "200px",          // Adjust the width for the size you want
                    height: "200px",         // Ensure the height matches the width
                    borderRadius: "50%",     // Makes the image circular
                    objectFit: "cover",      // Ensures the image fits within the circular area
                    border: "2px solid #fff",// Optional: Adds a white border around the logo
                    marginTop: "100px",        // Adds margin to move the logo lower
                    marginRight:"400px",
                  }}
                />
              </div>

             {/* Intro Section */}
             <div
                className="col-md-8 intro-text"
                style={{ 
                  marginLeft: "-px", // Move the text section to the left
                  marginTop: "-30px"   // Move the text section upwards
                }}
              >
                <h1>Welcome to Crown Prince Properties</h1>
                <p>{props.data ? props.data.paragraph : "Loading"}</p>
                <a href="#features" className="btn btn-custom btn-lg page-scroll">
                  Learn More
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
};
